import "./App.css";
import { Parallax, ParallaxLayer } from "@react-spring/parallax";

import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";
import Locations from "./routes/locations/locations.component";

const MainComponent = () => {
  return (
    <div className="main-component" style={{ backgroundColor: "yellow" }}>
      <h1>Main Component</h1>
    </div>
  );
};

const ParallaxComponent = ({ speed }) => {
  return (
    <ParallaxLayer speed={speed}>
      <div>
        <h2>Parallax Component</h2>
      </div>
    </ParallaxLayer>
  );
};

const App = () => {
  return (
    <MainComponent>
      <Parallax pages={3}>
        <ParallaxComponent speed={0.5} />
        <ParallaxComponent speed={0.75} />
        <ParallaxComponent speed={1} />
      </Parallax>
    </MainComponent>
  );
};

export default App;
